import React, {  useState } from 'react'
import Navbar from './contaner/Navbar';
import News from './contaner/News';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const App =(props)=> {
  const pagesize=6;
  const apikey= process.env.REACT_APP_NEWS_API ;
 const [progress,setProgress]= useState(0)
    return (
      <div>

       <Navbar/> 
   <LoadingBar height={3} color='#f11946'
   progress={progress} />
       <BrowserRouter>
       <Routes>
        <Route path='health' element={<News setProgress={setProgress} sizeofpage={pagesize}apikey={apikey} country="us" category='health'/>}/>
        <Route path='business' element={<News setProgress={setProgress} sizeofpage={pagesize}apikey={apikey} country="us" category='business'/>}/>
        <Route path='entertainment' element={<News setProgress={setProgress} sizeofpage={pagesize} apikey={apikey}country="us" category='entertainment'/>}/>
        <Route path='general' element={<News setProgress={setProgress} sizeofpage={pagesize}apikey={apikey} country="us" category='general'/>}/>
        <Route path='science' element={<News setProgress={setProgress} sizeofpage={pagesize}apikey={apikey} country="us" category='science'/>}/>
        <Route path='sports' element={<News setProgress={setProgress} sizeofpage={pagesize} apikey={apikey}country="us" category='sports'/>}/>
        <Route path='technology' element={<News setProgress={setProgress} sizeofpage={pagesize} apikey={apikey}country="us" category='technology'/>}/>
       </Routes>
       </BrowserRouter>


      </div>
    )
  }


export default App
